import React, { useRef } from 'react';
import { FiSearch } from 'react-icons/fi';
import { Column } from 'react-table';

import Header from '@/components/Header';
import Select from '@/components/Select';
import SEO from '@/components/SEO';
import Sidebar from '@/components/Sidebar';
import Table from '@/components/Table';
import Title from '@/components/Title';
import { Button, Flex, Text, Box, Tooltip } from '@chakra-ui/core';
import { FormHandles } from '@unform/core';
import { Form } from '@unform/web';

interface IFormData {
  email: string;
  password: string;
}

const GENERAL = [
  {
    Header: <Text color="#f33">M√™s</Text>,
    accessor: 'month',
  },
  {
    Header: <Text color="#4169e1">% F√≠sico acumulado previsto</Text>,
    accessor: 'estimated_cumultative_physics',
  },
  {
    Header: <Text color="#f33">% F√≠sico Acumulado Executado</Text>,
    accessor: 'cumulative_physics_executed',
  },
  {
    Header: <Text color="#4169e1">% F√≠sico Mensal Previsto</Text>,
    accessor: 'expected_monthly_physical',
  },
  {
    Header: <Text color="#f33">% F√≠sico Mensal Executado</Text>,
    accessor: 'physical_monthly_executed',
  },
  {
    Header: 'Desvio f√≠sico',
    accessor: 'physical_deviation',
  },
  {
    Header: <Text color="green.400">Obra adiantada (em dias)</Text>,
    accessor: 'performed_monthly_physicist',
  },
] as Column[];

const SUMMARY_OF_AHEAD_ACTIVITIES = [
  {
    Header: <Text color="#4169e1">Item</Text>,
    accessor: 'item',
  },
  {
    Header: <Text color="#4169e1">Atividades Adiantadas</Text>,
    accessor: 'late_activities',
  },
  {
    Header: <Text color="#4169e1">% Prev. At√© a data</Text>,
    accessor: 'prev',
  },
  {
    Header: <Text color="#4169e1">% Real. At√© a data</Text>,
    accessor: 'real',
  },
] as Column[];

const SUMMARY_OF_LATE_ACTIVITIES = [
  {
    Header: <Text color="#f33">Item</Text>,
    accessor: 'item',
  },
  {
    Header: <Text color="#f33">Atividades Atrasadas</Text>,
    accessor: 'late_activities',
  },
  {
    Header: <Text color="#f33">% Prev. At√© a data</Text>,
    accessor: 'prev',
  },
  {
    Header: <Text color="#f33">% Real. At√© a data</Text>,
    accessor: 'real',
  },
] as Column[];

const Dashboad: React.FC = () => {
  const formRef = useRef<FormHandles>(null);
  return (
    <>
      <SEO
        title="Lafe"
        image="og/boost.png"
        shouldExcludeTitleSuffix
        description="Fazer Dashboad na plataforma"
      />

      <Flex
        as="main"
        width="100%"
        direction="column"
        backgroundColor="blue.500"
      >
        <Header />
        <Flex marginTop={65} height="100%">
          <Sidebar />
          <Flex
            paddingX={6}
            paddingY={2}
            direction="column"
            height="100vh"
            width="100%"
          >
            <Flex color="White" direction="column">
              <Title>Filtros</Title>
              <Form
                css={{
                  width: '35%',
                  display: 'flex',
                  alignItems: 'center',
                  flexDirection: 'row',
                }}
                ref={formRef}
                onSubmit={() => {}}
              >
                <Select
                  height={8}
                  backgroundColor="White"
                  name="construction"
                  placeholder="Selecione a obra"
                  containerProps={{
                    border: '1px solid',
                    height: 10,
                    borderColor: 'gray.400',
                    bg: 'white',
                  }}
                >
                  <option value="Obra1">Obra1</option>
                  <option value="Obra2">Obra2</option>
                  <option value="Obra3">Obra3</option>
                </Select>
                <Select
                  height={8}
                  backgroundColor="White"
                  name="month"
                  placeholder="Selecione o m√™s"
                  containerProps={{
                    height: 10,
                    marginLeft: '16px',
                    border: '1px solid',
                    borderColor: 'gray.400',
                    bg: 'white',
                  }}
                >
                  <option value="M√™s1">M√™s1</option>
                  <option value="M√™s2">M√™s2</option>
                  <option value="M√™s3">M√™s3</option>
                </Select>
                <Tooltip
                  label="Pesquisar vel√≥rios por cemit√©rio"
                  aria-label="Pesquisar vel√≥rios por cemit√©rio"
                >
                  <Button marginLeft={4} height={10} type="submit">
                    <FiSearch color="Black" size={40} />
                  </Button>
                </Tooltip>
              </Form>
            </Flex>
            <Flex
              marginTop={2}
              overflowY="auto"
              direction="column"
              paddingRight={4}
              paddingY={2}
            >
              <Box
                width="100%"
                marginTop={4}
                display="grid"
                gridTemplateColumns="60% 40%"
              >
                <Table
                  data={[
                    {
                      month: <Text color="#f33">set-20</Text>,
                      estimated_cumultative_physics: (
                        <Text color="#4169e1">05%</Text>
                      ),
                      cumulative_physics_executed: (
                        <Text color="#f33">56,85%</Text>
                      ),
                      expected_monthly_physical: (
                        <Text color="#4169e1">3,94%</Text>
                      ),
                      physical_monthly_executed: (
                        <Text color="#f33">8,27%</Text>
                      ),
                      physical_deviation: '8,43%',
                      performed_monthly_physicist: (
                        <Text color="green.400">34</Text>
                      ),
                    },
                  ]}
                  columns={GENERAL}
                />
                <Flex width="49%" direction="column">
                  <Table
                    title="Principais Atividades Resumo"
                    data={[
